import React from 'react';
import profile from '../img/tylerProfile.jpg';


export default function Home() {

  return (
    <div>
      <h1>About Me</h1>
      <img 
        style={{height: 10}}
        src={profile}
        alt="Tyler's Photo" />
      <p>
         Front-end web developer integrating childcare and healthcare backgrounds to tap into the potential of communication between user and technology.  Receiving my certificate from the UW coding bootcamp, I have honed my skills in Javascript, CSS, HTML, and Node.js.  Known amongst colleagues for sharp attention to detail and a passion for interesting user-friendly design, my focus is on Web and UI Design.  With every project, my goal is to create a visually engaging experience for the user that also allows clients to express their personality through their products.  I love the creative process and am passionate about tying a clientâ€™s vision with their web-page.
      </p>
    </div>
  );
}
